import React from 'react';

const DayToDayPage = () => {
  return (
    <div style={styles.page}>
      <h3>Day-to-Day Carbon Emissions</h3>
      <table style={styles.table}>
        <thead>
          <tr>
            <th>Activity</th>
            <th>Carbon Emissions (kg/day)</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Driving a car (15 miles)</td>
            <td>4.6</td>
          </tr>
          <tr>
            <td>Heating home</td>
            <td>7.2</td>
          </tr>
          <tr>
            <td>Electricity usage</td>
            <td>5.1</td>
          </tr>
          {/* Add more activities and emissions */}
        </tbody>
      </table>
    </div>
  );
};

const styles = {
  page: {
    textAlign: 'center',
    marginTop: '50px',
    color: '#fff',
    backgroundColor: '#282c34',
    padding: '20px',
  },
  table: {
    margin: '20px auto',
    width: '80%',
    borderCollapse: 'collapse',
  },
  th: {
    backgroundColor: '#61dafb',
    padding: '10px',
  },
  td: {
    textAlign: 'center',
    padding: '10px',
    border: '1px solid #ddd',
  },
};

export default DayToDayPage;
